            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "Because it was theorized that speed of light always remains constant, even in a relative frame. If you travelled at say 50% the speed of light and cast a beam in front of you, light would still appear to go at 3√ó10‚Å∏ ms in front of you. This is what was contradicting Newton&#39;s laws of motion.",
              "textOriginal": "Because it was theorized that speed of light always remains constant, even in a relative frame. If you travelled at say 50% the speed of light and cast a beam in front of you, light would still appear to go at 3√ó10‚Å∏ ms in front of you. This is what was contradicting Newton's laws of motion.",
              "parentId": "UgznJYL1CfIkseeZNqV4AaABAg",
              "authorDisplayName": "Arishem The Judge",
              "authorProfileImageUrl": "https://yt3.ggpht.com/Rcs_eRTw_WXU1nX6L6uBQwfZBMKRbq_CykMqFLp2VNK9BcS5KTHT0Wv1Fy5hJUYUiTq9PTf9VA=s48-c-k-c0x00ffffff-no-rj",
